● 1. Awọn ọja jẹ incombustible ti A1 ipele ati ki o yoo ko combust tabi fun pipa majele ti ategun;
● 2. Awọn ohun kohun ti Hebang rockwool ko le jo, wọn kii ṣe ooru tabi èéfín majele, nitori naa wọn ni aabo ina ti o dara julọ ati pe o le yago fun imunadoko ti ntan ninu ina.
● 3.Awọn ọja naa ni agbara ipanu ati agbara fifẹ ni ila pẹlu awọn ibeere ti o yẹ ti o tobi-igba awọ irin ipanu ipanu;
Hebang rockwool fun awọn igbimọ ounjẹ ipanu ni agbara iduroṣinṣin ati awọn atọka agbara, eyiti o ṣe iṣeduro
... 
ẹ.
● 4.Awọn ọja naa ni idabobo ooru ti o dara ati iṣẹ-itọju ti o duro ati iduroṣinṣin;
Pẹlu idabobo ooru to dara ati iṣẹ ṣiṣe itọju, awọn ọja le ṣe alekun awọn iye resistance igbona ti awọn ẹya ti awọn ile ati ṣe akiyesi fifipamọ agbara ati idinku itujade nipa idinku agbara ti o jẹ nipasẹ alapapo ati awọn ohun elo imuletutu ti awọn ile.
● 5. Awọn ọja naa ni idaduro idinku ti o dara labẹ awọn iwọn otutu giga ati nitorina o le ṣetọju awọn eto eto iduroṣinṣin ninu awọn ina;
● 6. Awọn ọja kii yoo ba
...
fifin ati ṣe sinu awọn ọja ti o tobi julọ nipasẹ isọdi lati pade iwulo ti awọn akoko pataki.
Lẹhin ti a ṣe sinu awọn igbimọ rockwool tabi awọn ọpá pẹlu awọn okun ti a ṣeto ni inaro, TAIBAI rockwool fun awọn igbimọ ounjẹ ipanu le ṣe idapo pẹlu awọn oju ti fadaka nipasẹ ọna asopọ ati lẹhinna ṣe ẹrọ sinu awọn igbimọ ipanu apata wool ti o ni oju irin.Ṣeun si awọn okun idayatọ wọn ni inaro, awọn igbimọ ipanu apata wool ti o dojukọ irin jẹ ifihan nipasẹ agbara rirẹ giga, agbara fisinu ati agbara fifẹ.
